        <meta charset="utf-8">
        <title>Gato</title>
        <link rel="stylesheet" href="css/estilos.css">
        <script>
window.onload = () => {
    let imgs = document.getElementsByTagName("img");
    listaP = [];
    for (let i = 0; i < imgs.length; i++) {
        p = document.createElement("p");
        p.setAttribute("id", i);
        listaP.push(p);
    }
    for (let i = 0; i < imgs.length; i++) {
        dive.setAttribute("clicks", 0);
        dive.addEventListener("click", (e) => {
            e.target.setAttribute("clicks", parseInt(e.target.getAttribute("clicks")) + 1);
            e.target.parentNode.appendChild(listaP[i])
            e.target.parentNode.appendChild(listaP[i]).innetHTML = `ha sido clickeado ${parseInt(e.target.getAttribute("clicks"))} veces`;
        });
    }
}
        </script>
